INSERT INTO `v1_a79a38b9211046d78cd97c4f24199ea9f765838fc2ca3eedf49b0f9cb24a634b` VALUES (0, 3, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", "---", "アサヒ", 1, 1, "", 2, 6000);
INSERT INTO `v1_a79a38b9211046d78cd97c4f24199ea9f765838fc2ca3eedf49b0f9cb24a634b` VALUES (3, 0, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", "アドレナリン", "部員3", 3, 1, "ホームランを連発すると、連発数に応じてパワーアップする", 3, 16000);
INSERT INTO `v1_a79a38b9211046d78cd97c4f24199ea9f765838fc2ca3eedf49b0f9cb24a634b` VALUES (2, 2, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", "ラッキー", "{0}", 2, 1, "幸運のハプニングを呼び込む", 4, 30000);
INSERT INTO `v1_a79a38b9211046d78cd97c4f24199ea9f765838fc2ca3eedf49b0f9cb24a634b` VALUES (1, 1, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", "", "選手名鑑 おまけページ", 0, 0, "", 5, 50000);
